class Result{constructor(){this.reset()}reset(){this.data={matched:{keys:[],values:[]},unmatched:{keys:[],values:[],types:[]},regexChecks:{passed:[],failed:[]},summary:{matchPercentage:0,totalKeysCompared:0,totalMatched:0,totalUnmatched:0,totalRegexChecks:0}}}addMatchedKey(e){this.data.matched.keys.push(e)}addMatchedValue(e){this.data.matched.values.push(e)}addUnmatchedKey(e){this.data.unmatched.keys.push(e)}addUnmatchedValue(e){this.data.unmatched.values.push(e)}addUnmatchedType(e){this.data.unmatched.types.push(e)}addPassedRegexCheck(e){this.data.regexChecks.passed.push(e)}addFailedRegexCheck(e){this.data.regexChecks.failed.push(e)}updateSummary(){const e=this.data.matched.keys.length,t=this.data.unmatched.keys.length+this.data.unmatched.values.length+this.data.unmatched.types.length,a=e+t,s=this.data.regexChecks.passed.length+this.data.regexChecks.failed.length;this.data.summary={matchPercentage:a>0?e/a*100:100,totalKeysCompared:a,totalMatched:e,totalUnmatched:t,totalRegexChecks:s}}getResult(){return this.data}}module.exports=Result;